pragma solidity ^0.6.12;

// import "../token/token/ERC20/SDBtoken.sol";
import "../token/token/SafeBEP20.sol";
import "../access/Ownable.sol";
import "../libraries/TransferHelper.sol";


contract Vendor is Ownable {
using SafeMath for uint256;
using SafeBEP20 for IBEP20;

bytes4 private constant SELECTOR = bytes4(keccak256(bytes('transfer(address,uint256)')));


uint256 public tokenperUSD = 1;
uint256 public totalAllocPoint = 0;
uint256 public totalMoneyPoint = 0;

struct UserInfo{
  uint256 amountUSD;
  address user;
}
address public sdbtoken;
address public usdtoken;


struct PoolInfo{
  IBEP20 sdbtoken;//address sdb
  uint256 sdbPoint;//how many sdb is here
  IBEP20 usdtoken;//adress usd
  uint256 usdPoint;//how many usd is here
}
PoolInfo[] public poolInfo;

mapping(uint256 => mapping(address =>UserInfo)) public userInfo;

event Swap (address indexed user, uint256 indexed pid, uint256 amountUSD);
event Withdraw(address indexed user,uint256 indexed pid, uint256 amountSDB);

constructor(address _sdbtoken, address _usdtoken)public{
  sdbtoken = _sdbtoken;
  usdtoken = _usdtoken;
}


function add(IBEP20 _sdbtoken, uint256 _sdbPoint, IBEP20 _usdtoken)public onlyOwner{
  totalAllocPoint = totalAllocPoint.add(_sdbPoint);
  poolInfo.push(PoolInfo({
  sdbtoken: _sdbtoken,
  sdbPoint: 0,
  usdtoken: _usdtoken,
  usdPoint: 0
}));
}

function set(uint256 _pid, uint256 _sdbPoint) public onlyOwner{
  PoolInfo storage pool = poolInfo[_pid];
  uint256 prevSDBPoint = poolInfo[_pid].sdbPoint;
  pool.sdbtoken.safeTransferFrom(address(msg.sender), address(this), _sdbPoint);
  poolInfo[_pid].sdbPoint = _sdbPoint;
  
  totalAllocPoint = totalAllocPoint.add(prevSDBPoint).add(_sdbPoint);
  pool.sdbPoint.add(_sdbPoint);
}

function changeTokenPerUSD(uint256 newValue) public onlyOwner{
  tokenperUSD = newValue;
}

function swapUSDforSDB(uint256 _pid, uint256 amountUSD) public {
  PoolInfo storage pool = poolInfo[_pid];
  UserInfo storage user = userInfo[_pid][msg.sender];
  
  pool.usdtoken.safeTransferFrom(address(msg.sender),address(this),amountUSD);
  pool.usdPoint = poolInfo[_pid].usdPoint.add(amountUSD);
  pool.usdPoint.add(amountUSD);
  
  uint amountSDB;
  amountSDB = tokenperUSD * amountUSD;
  pool.sdbtoken.safeTransfer( address(msg.sender),amountSDB);
  pool.sdbPoint = poolInfo[_pid].sdbPoint.sub(amountSDB);  
  totalMoneyPoint = totalMoneyPoint.add(amountUSD);
  totalAllocPoint = totalAllocPoint.sub(amountSDB);
  user.amountUSD.add(amountUSD);
  emit Swap(msg.sender,_pid, amountUSD);
}


function safeSDBTransfer(address _from,address _to, uint256 _amount)internal{
  TransferHelper.safeTransfer(_from,_to, _amount);
}

function withdraw(uint256 _pid, uint256 _amount)public onlyOwner{
  
  PoolInfo storage pool = poolInfo[_pid];

  pool.usdtoken.safeTransfer(address(msg.sender), _amount );
  pool.usdPoint = poolInfo[_pid].usdPoint.sub(_amount);
  pool.usdPoint.add(_amount);
  totalMoneyPoint = totalMoneyPoint.sub(_amount);
    
  emit Withdraw(msg.sender, _pid, _amount);
}

function returnSDB(uint256 _pid, uint256 _amountOut) public onlyOwner{
  
  PoolInfo storage pool = poolInfo[_pid];
  pool.sdbtoken.safeTransfer(address(msg.sender), _amountOut);
  pool.sdbPoint = poolInfo[_pid].sdbPoint.sub(_amountOut);  
  totalAllocPoint = totalAllocPoint.sub(_amountOut);
}
}
